import { useState } from 'react';

function App() {
  const [balance, setBalance] = useState(100, (newBalance) => {
    balance = newBalance;
    console.log({balance});
  });
  function handleClick(){
    preventDefault();
    setBalance(balance + 100);

  }
  return (
    <div className="App">
      <form>
        <p>sign up</p> <br />
